import React from 'react';
import { Link } from 'react-router-dom';

import { Container } from './styles';

export default function Pages() {
  return (
    <div>
        <input type="text"/>
        <Link to="/">
            <button type="button" className="btn btn-primary">Sair</button>
        </Link>
    </div>
  );
}
